import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import slide from "./slide.css";

export default class MultipleItems extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3
    };
    return (
      <div>
        <h2> Multiple items </h2>
        <Slider {...settings}>
          <div>
           <img className="slider_img" src="/images/disney.jpg" alt="project" />
          </div>
          <div>
            <img className="slider_img" src="/images/disney.jpg" alt="project" />
          </div>
          <div>
           <img className="slider_img" src="/images/disney.jpg" alt="project" />
          </div>
          <div>
            <img className="slider_img" src="/images/disney.jpg" alt="project" />
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
          <div>
            <h3>7</h3>
          </div>
          <div>
            <h3>8</h3>
          </div>
          <div>
            <h3>9</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
